import React from "react";

function Apie() {
  return (
    <>
      <h2>Apie mane</h2>
          <p class="aprasymas">Aš esu grafikos dizainerė ir iliustratorė. Mano veikla
          apima reklamos, brandingo dizainas. Aš taip pat užsiimu vizualizacijų
          animavimų ir skaitmeniniu piešimu.</p><p class="aprasymas2">
          Aš esu kilusi iš Lietuvos tačiau gyvenau ne vienoje šalyje. Taip aš įgijau daug patirties
          bendraudama su įvairių kultūrų žmonėmis. Man labai svarbu
          suprasti kliento poreikius ir išpildyti jo vizija bei papildyti ją savo vaizduotės
          sugebėjimais. Mokymasis įvairiose dailės bureliuose bei Vienožinskio dailės mokyklos
          baigimas padėjo man patobulinti gėbėjimus dizaino srityje. Be to, savanoriaudama
          mokyklos savivaldoje turėjau progą išmokti kurti reklamines vizualizacijas.</p>
          
    </>
  );
}

export default Apie;
